import React from 'react'

function TopBtns() {

    const cities = [
        {
            id: 1,
            title: 'london'
        },{
            id: 2,
            title: 'sydney'
        },{
            id: 3,
            title: 'Tokyo'
        },{
            id: 4,
            title: 'Toronto'
        },{
            id: 5,
            title: 'Paris'
        },
    ]

  return (
    <div className='top-btns'>
        Topbtns
    </div>
  )
}

export default TopBtns
